    },
    {
        // icon : 'fa-solid fa-arrow-trend-up',
        img: require('../Assets/images/transferMoney.jpg'),
        title : 'تحويل الأموال',
        des : 'قم بتحويل الأموال بسهولة وأمان عبر خدمات التحويل المتاحة لدينا',
    },
]
export default dataService;
